TEST(BPSK, complexMultiply)
{
    // (3 + 2i)(1 + 4i) = 3 + 12i + 2i + 8i^2 = -5 + 14i
    static const int length = 100;
    RADIO_DATA_TYPE ra = 3;
    RADIO_DATA_TYPE ia = 2;
    RADIO_DATA_TYPE rb = 1;
    RADIO_DATA_TYPE ib = 4;
    RADIO_DATA_TYPE rc = 0; // -5
    RADIO_DATA_TYPE ic = 0; // 14

    BPSK bpsk;

    bpsk.complex_multiply(ra, ia, rb, ib, rc, ic);

    ASSERT_NEAR(-5.0, rc, 0.000001) << "Real Failed";
    ASSERT_NEAR(14, ic, 0.000001) << "Imag Failed";
}

